import React from "react";
import arnowa from "./arnowa.png";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
function Header(){
    return(
        <>
            <div className="container text-center" >
                <img src={arnowa} style={{width:400}}/>
                <br />
            </div>
        </>
    );
}

export default Header;
